import axios from "axios";
import React, { useEffect } from "react";

function App() {
  useEffect(() => {
    axios
      .get("http://localhost:5001")
      .then((res) => console.log(res.data))
      .catch((err) => {
        console.log(err, "errr");
      });
  }, []);

  return <div>App</div>;
}

export default App;
